import React, { useEffect, useState } from "react";
import "./App.css";
import {
  BrowserRouter,
  Routes,
  Route,
  useNavigate,
} from "react-router-dom";
import axios from "axios";

import AuthPage from "./pages/AuthPage";
import ResetPasswordPage from "./pages/ResetPasswordPage";
import HomePage from "./pages/HomePage";
import AccountPage from "./pages/AccountPage";
import CountryPage from "./pages/CountryPage";
import PackagePage from "./pages/PackagePage";
import CategoryPage from "./pages/CategoryPage";
import BookPage from "./pages/BookPage";

import AdminPage from "./pages/AdminPage";
import AdminListingsPage from "./pages/AdminListingsPage";
import AdminEditListingPage from "./pages/AdminEditListingPage";
import AdminEditUserPage from "./pages/AdminEditUserPage";  // ← new

function ProtectedRoute({ children, allowedRole }) {
  const [ok, setOk] = useState(null);
  const nav = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("jwt");
    if (!token) return nav("/login");
    axios
      .get("/api/users/me", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then(({ data }) => {
        if (allowedRole && data.role !== allowedRole) {
          return nav("/login");
        }
        setOk(true);
      })
      .catch(() => nav("/login"));
  }, [allowedRole, nav]);

  if (ok === null) return <div>Loading…</div>;
  return ok ? children : null;
}

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* public */}
        <Route path="/" element={<AuthPage />} />
        <Route path="/login" element={<AuthPage />} />
        <Route path="/reset-password" element={<ResetPasswordPage />} />

        {/* user-only */}
        <Route
          path="/home"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <HomePage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/account"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <AccountPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/destinations/:code"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <CountryPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/packages/:pid"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <PackagePage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/flights"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <CategoryPage category="flights" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/hotels"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <CategoryPage category="hotels" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/events"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <CategoryPage category="events" />
            </ProtectedRoute>
          }
        />
        <Route
          path="/book/:category/:id"
          element={
            <ProtectedRoute allowedRole="ROLE_USER">
              <BookPage />
            </ProtectedRoute>
          }
        />

        {/* admin */}
        <Route
          path="/admin"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/:category"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminListingsPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/:category/new"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminEditListingPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/:category/:id/edit"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              {/** delegate to user editor if category==='users' **/}
              <AdminEditListingPage />
            </ProtectedRoute>
          }
        />
        {/** user-edit route **/}
        <Route
          path="/admin/users/:id/edit"
          element={
            <ProtectedRoute allowedRole="ROLE_ADMIN">
              <AdminEditUserPage />
            </ProtectedRoute>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}
